import React from "react";
import styles from "../styles";
const BoxProdut = (props) => {
  return (
    <div style={styles.photmar} key={props.id}>
      <img src={props.image} alt={props.name} style={styles.prodimag} />
      <p style={styles.text}>{props.name}</p>
      <p style={styles.text}> {props.price} KD</p>
    </div>
  );
};

export default BoxProdut;
